INSERT INTO `extadding` VALUES
(1,'testing extension','http://localhost/linklibrary/extensionaddingpage','http://localhost/linklibrary/uploads/',1,'                                         Place <em>some</em> <u>text</u> <strong>here</strong>\r\n                                             ',1,'free','','2023-12-18 00:00:00'),
(6,'OneTab','https://chrome.google.com/webstore/detail/onetab/chphlpgkkbolifaimnlloiipkdnihall','https://linklibrary.site/uploads/4e21fc038ef623b294c024bd08ca7589.png',3,'<p>OneTab is a highly popular browser extension that streamlines tab management, making it an indispensable tool for users who frequently find themselves with an overwhelming number of open tabs. Developed as an extension for Google Chrome and Mozilla Firefox, this ingenious add-on allows users to condense multiple open tabs into a single, easily accessible list. With just a click, users can convert a cluttered tab bar into a neatly organized list of links. This not only significantly reduces memory usage and browser lag but also enhances productivity by simplifying the process of switching between tasks. Additionally, OneTab provides options to name and group saved tabs, making it effortless to categorize and revisit specific sets of web pages, which is particularly beneficial for research, project management, or simply keeping track of interesting articles.</p>\r\n\r\n<p>Beyond its core functionality, OneTab offers a range of customizable features to cater to individual preferences. Users have the option to restore tabs individually or all at once, ensuring flexibility in how they interact with their saved sessions. Furthermore, OneTab&#39;s export feature allows users to save their tab lists for later use or share them with colleagues and collaborators. This proves invaluable for collaborative projects and knowledge sharing. The extension also boasts a sleek, user-friendly interface that seamlessly integrates with the browser, making it intuitive and straightforward to use. With its ability to alleviate tab clutter, enhance performance, and simplify tab organization, OneTab stands as an essential tool for anyone seeking a more efficient and streamlined browsing experience.</p>\r\n',1,'Free','<span style=\"color: rgb(153, 153, 153); font-family: Roboto, Arial, sans-serif; font-size: 17px; text-align: center;\">OneTab is a browser extension that consolidates open tabs into a single list to save memory and improve productivity.</span>','2023-12-18 00:00:00'),
(7,'Muzli','https://chrome.google.com/webstore/detail/muzli-design-inspiration/glcipcfhmopcgidicgdociohdoicpdfc/related?hl=en','https://linklibrary.site/uploads/3bc45d803dbe7b1b163308e5cc18d63b.png',3,'<p>Muzli is a dynamic browser extension tailored for creative professionals and design enthusiasts. Developed by InVision, a leading design collaboration platform, Muzli serves as a versatile source of design inspiration directly within the user&#39;s browser. Upon installation, Muzli transforms the new tab page into a curated feed of the latest and most innovative design trends, articles, and resources from around the web. This extension caters to a wide spectrum of design disciplines, including web design, graphic design, UX/UI, and more. Users are greeted with a visually appealing mosaic of thumbnails showcasing noteworthy design projects, which can be clicked for a closer look or further exploration. Muzli&#39;s intuitive interface and seamless integration make it an invaluable asset for designers seeking a convenient and inspiring way to stay updated with the latest trends and techniques in the ever-evolving world of design.</p>\r\n\r\n<p>One of Muzli&#39;s standout features is its adaptability to individual preferences. Users have the ability to customize their feed based on specific design interests, ensuring that the content presented aligns with their unique creative endeavors. Beyond its role as a source of inspiration, Muzli also provides a curated selection of design-related articles, tutorials, and tools, creating a comprehensive resource hub for designers looking to expand their skill set and knowledge base. With its sleek design, user-friendly interface, and robust content offerings, Muzli empowers designers to stay at the forefront of their field, making it an indispensable browser extension for anyone passionate about visual design and its myriad applications.</p>\r\n',1,'Both','<span style=\"color: rgb(153, 153, 153); font-family: Roboto, Arial, sans-serif; font-size: 17px; text-align: center;\">Muzli is a browser extension that provides design inspiration and news, as well as a curated selection of design resources.</span>','2023-12-18 00:00:00'),
(8,'Honey','https://chrome.google.com/webstore/detail/honey-automatic-coupons-r/bmnlcjabgnpnenekpadlanbbkooimhnj/related','https://linklibrary.site/uploads/2b2d5df6fc7d30e881e775a112d154a4.png',3,'<p>Honey is a popular browser extension designed to help online shoppers save money effortlessly. Developed by Honey Science Corporation, this innovative tool revolutionizes the way users find and apply discounts and coupons while shopping online. Once installed, Honey automatically scans the web for available coupon codes and applies them at checkout on supported websites. This means users no longer need to go through the hassle of manually searching for valid codes or deals. Honey supports a vast array of online retailers, from major e-commerce platforms to niche specialty stores, making it a versatile money-saving companion for a wide range of consumers. Its intuitive interface seamlessly integrates with various browsers, including Google Chrome, Mozilla Firefox, Safari, and Microsoft Edge, ensuring a hassle-free experience for users seeking to maximize their savings during online shopping sprees.</p>\r\n\r\n<p>One of Honey&#39;s standout features is its robust price tracking functionality. The extension allows users to add items to their &quot;Droplist,&quot; a personalized watchlist for specific products they&#39;re interested in purchasing. Honey then monitors the prices of these items and notifies users when there&#39;s a significant drop, ensuring they get the best possible deal. Additionally, Honey offers a rewards program known as Honey Gold, where users can earn points for purchases made through the extension. These points can be redeemed for gift cards, providing an extra layer of savings for avid online shoppers. With its user-friendly interface, automatic coupon application, price tracking, and rewards program, Honey has become an indispensable tool for savvy online consumers looking to make their shopping experiences not only more economical but also more convenient.</p>\r\n',1,'Free','<span style=\"color: rgb(153, 153, 153); font-family: Roboto, Arial, sans-serif; font-size: 17px; text-align: center;\">Honey is a browser extension that automatically finds and applies coupon codes to help users save money while shopping online.</span>','2023-12-18 00:00:00');
