('a2239581-b180-11ee-82c3-d9f43d52e585','Privnote','https://privnote.com','https://sitesaverhub.com/uploads/f844af89572139aa0a2077b0eef0490c.png',20,'<p><strong>Privnote: Protect your privacy with self-destructing notes. Send confidential messages that vanish after reading and ensuring security.</strong></p>\r\n',1,'Both','												<p><div>Privnote is a secure and user-friendly online platform that allows users to send self-destructing notes. With a focus on privacy and confidentiality, Privnote enables individuals to share sensitive information without leaving a lasting digital trail.</div><div><br></div><div>Users can compose a note, set a preferred lifespan for the message, and send it to the recipient. Once the note is read, it is automatically deleted, ensuring that the information remains confidential and is not stored on the platform. Privnote is widely used in situations where privacy and data security are paramount, making it a valuable tool for sharing sensitive information or personal messages while maintaining a high level of security and discretion.</div></p>\r\n                                             ','2024-01-12 19:27:32'),
('a22395be-b180-11ee-82c3-d9f43d52e585','TED ','https://www.ted.com','https://sitesaverhub.com/uploads/5697c1dd45a9bbb3fe33ecaed6ed495e.png',20,'<p><strong>TED: A global platform for inspiring ideas. Explore thought-provoking talks, discussions, and innovations to broaden your horizons.</strong></p>\r\n',1,'Both','												<p><div><br></div><div>The TED website is a virtual stage for some of the world\'s most inspiring and innovative ideas. It features a vast library of TED Talks, short, powerful presentations on a wide range of subjects, from science and technology to art and culture. TED Talks are delivered by thought leaders, experts, and visionaries, making the website a rich source of knowledge and inspiration.</div><div><br></div><div>TED\'s mission is to spread ideas and spark curiosity, making information accessible to people around the globe. The website is an open window to the world of transformative concepts, offering opportunities to learn, reflect, and engage with ideas that can change the way we think and live. Whether you\'re interested in personal growth, global issues, or simply enjoy thought-provoking discussions, the TED website provides a captivating platform to explore, learn, and be inspired.</div></p>\r\n                                             ','2024-01-12 19:27:32'),
('a22395fd-b180-11ee-82c3-d9f43d52e585','Grammarly','https://www.grammarly.com','https://sitesaverhub.com/uploads/7869e2d357bff9d2c99c352b491acaff.png',20,'<p><strong>Grammarly: Elevate your writing with real-time grammar and style suggestions. Enhance your communication and professional documents effortlessly</strong></p>\r\n',1,'Both','												<p><div><span style=\"font-size: 1rem;\">Grammarly is a highly popular and user-friendly writing tool that assists individuals in enhancing their written communication. With its browser extension, desktop app, and web platform, Grammarly seamlessly integrates into your writing workflow, providing real-time suggestions and corrections for grammar, spelling, punctuation, and even style.</span><br></div><div><br></div><div>One of Grammarly\'s standout features is its ability to adapt to various writing contexts, whether it\'s professional emails, academic essays, or casual social media posts. The website offers a free version with basic grammar checks, while the premium subscription provides more advanced features, such as plagiarism detection and improved writing clarity. Grammarly is a valuable companion for anyone seeking to elevate their writing skills and ensure clarity and correctness in their written content, making it a widely embraced tool in the world of digital communication.</div><div><br></div><div><br></div><div><br></div><div><br></div></p>\r\n                                             ','2024-01-12 19:27:32'),
